function Useeffectdemo()
{
    let[counter,setCounter]=useState(0)
    useEffect(()=>{
        console.log('use effect executed')
    },[])
    const changeState1=()=>{
        setCounter(counter1+1)
    }
    const changeState2=()=>{
        setCounter(counter+1)
    }
    return(
        <div>
            <h1>Use effect demo</h1>
            <p className="display-1">Counter1:{counter}</p>
            <p className="display-1">Counter2:{counter}</p>
          <button className="btn btn-info" onClick={changeState1}>Change1</button>
          <button className="btn btn-secondary" onClick={changeState2}>Change2</button>

        </div>
    )
}
export default Useeffectdemo;
